	('40a5046d-c9c4-4c64-ad24-416fd3ff8a20', 'TUTORIAL PEMBUATAN AKUN, PASSPHRASE & SPT DI CORETAX', '<p><span class="ql-size-large">Dear All,</span></p><p><br></p><p><br></p><p><span class="ql-size-large">Kami lampirkan materi Sosialisasi Coretax beserta tutorialnya:</span></p><p><br></p><p><span class="ql-size-large">1. Aktivasi Akun,  digunakan saat login Coretax</span></p><p><span class="ql-size-large">2. Aktivasi Kode Otorisasi DJP (disebut dengan Sertifikat Elektronik/Passphrase), </span>	<span class="ql-size-large">digunakan untuk memenuhi kewajiban perpajakan, contoh: lapor SPT</span></p><p><span class="ql-size-large">3. Panduan SPT Tahunan WP OP</span></p><p><br></p><p><br></p><p><span class="ql-size-large">Thanks &amp; Regards,</span></p><p><span class="ql-size-large">Yohan</span></p>', 'General', '/uploads/news/1771468117028-910680070.jpg', 'published', '2026-02-19 09:18:00', NULL, 19, 0, 1, 'normal', 0, '2026-02-19 02:28:37', '2026-02-19 02:28:37', NULL),
	('d88b6dcf-3c38-4404-b260-1fd8acd0ef62', 'Internal Memo - Pengaturan Jam Kerja Selama Bulan Puasa Tahun 2026', '<p><span class="ql-size-large">Dear All,</span></p><p><span class="ql-size-large">&nbsp;</span></p><p><span class="ql-size-large">Berikut ini kami sampaikan revisi memo untuk pengaturan jam kerja selama bulan puasa tahun 2026 dan mohon untuk dapat dilaksanakan.</span></p><p><span class="ql-size-large">&nbsp;</span></p><p><span class="ql-size-large">Demikian informasi ini kami sampaikan, Kami ucapkan terima kasih.</span></p><p><span class="ql-size-large">&nbsp;</span></p><p><span class="ql-size-large">*Revisi terdapat pada Jam kerja shift 2 &amp; Shift 3 pada hari Jumat.</span></p><p><br></p><p><span class="ql-size-large"><span class="ql-cursor"></span></span><img src="data:image/png;base64,"></p><p><span style="color: rgb(31, 73, 125);" class="ql-size-large">&nbsp;</span></p><p><em class="ql-size-large">Terima Kasih</em></p><p><em class="ql-size-large">Best Regards</em></p><p><em class="ql-size-large">Lukman Nulhakim</em></p><p><em class="ql-size-large">HR Dept.</em></p>', 'Pengumuman', '/uploads/news/1771466877970-791955136.jpg', 'published', '2026-02-19 09:01:00', NULL, 19, 0, 1, 'normal', 0, '2026-02-19 02:07:58', '2026-02-19 02:07:58', NULL);
INSERT INTO `news` (`id`, `title`, `content`, `category`, `cover_image`, `status`, `publish_at`, `close_date`, `created_by`, `allow_comments`, `pin_top`, `priority`, `view_count`, `created_at`, `updated_at`, `deleted_at`) VALUES
	('e3b893be-c8f3-4f69-add3-bc882c3be9db', 'JADWAL PETUGAS PIKET TUTUP KANTOR BULAN FEBRUARI 2026', '<p><span class="ql-size-large">Dear Team,</span></p><p><span class="ql-size-large">&nbsp;</span></p><p><span class="ql-size-large">Berikut terlampir saya kirimkan jadwal petugas piket tutup kantor bulan Februari tahun 2026, mohon agar dapat dijalankan sesuai jadwal yang sudah ditetapkan. Terima kasih.</span></p><p><span class="ql-size-large">&nbsp;</span></p><p><br></p><p><img src="data:image/png;base64,"></p><p><br></p><p><span class="ql-size-large">Regards,</span></p><p><span class="ql-size-large">Samsul</span></p><p><span class="ql-size-large">HRGA Dept</span></p>', 'HRGA', '/uploads/news/1771468468852-706715863.jpg', 'published', '2026-02-19 09:34:00', '2026-03-01 06:34:00', 19, 0, 1, 'normal', 0, '2026-02-19 02:34:28', '2026-02-19 02:34:28', NULL);
